        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-967u-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'player.related_videos', 'Ähnliche Videos')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-97u3-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'category.related_videos', 'Ähnliche Videos')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-7u93-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'buttons.load_more', 'Mehr laden')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dcc1k0', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.1', 'Wie kann ich mein 100% Sport-Abonnement kündigen?')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dcck0a', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.1', '100% Sport ist ein Abonnement-Dienst, der jede Woche oder jeden Tag (wie anwendbar) automatisch erneuert wird, sofern Sie nicht kündigen. Sie können Ihr Abonnement jederzeit kündigen, indem Sie in Ihrem persönlichen Menü auf (Symbol oben rechts im Display) auf den Link Mein 100% Sport Verlassen klicken. Abhängig von Ihrem Mobilfunkanbieter können Sie Ihr Abonnement durch Senden einer SMS kündigen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dck0ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.2', 'Wo kann ich alle Videos sehen?')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dk01ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.2', 'Um deine Sportvideos anzusehen, besuche einfach unserer <a href=\"%home_url%\">Homepage</a> und klicke auf ein verfügbares Video. Du kannst unseren gesamten Katalog im Hauptmenü durchsuchen (Suche nach Titel oder Kategorie).')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0k0c1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.3', 'Ich habe bereits ein Spiel heruntergeladen, kann es aber nicht auf meinem Mobilgerät installieren. Woran liegt das?')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0ek0cc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.3', 'Stellen Sie zunächst sicher, dass Sie berechtigt sind, Apps aus anderen Quellen als Google Play zu installieren. Gehen Sie auf Ihrem Gerät zu Einstellungen / Sicherheit / Geräteverwaltung und aktivieren Sie die Installation von Apps aus unbekannten Quellen. Außerdem können Sie prüfen, ob auf Ihrem Gerät genügend Speicherplatz vorhanden ist. Wenn das Problem weiterhin besteht, zögern Sie nicht, uns zu kontaktieren')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0k0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.4', 'Ist es sicher, Spiele aus dem 100% Sport herunterzuladen?')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cdk00dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.4', 'Ja, alle 100% Sport sind zu sicher für Ihr Mobilgerät und Ihre persönlichen Daten.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7ck0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.5', 'Ich habe 100% Sport abonniert. Wenn ich mich abmelde, wie lange kann ich dann noch auf Videos zugreifen?')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7k00e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.5', 'Du behältst Zugang zu 100% Sport, bis der letzte bezahlte Zeitraum abgelaufen ist. Bei einem Tagesabo, das heute bereits verlängert wurde, kannst du beispielsweise alle Videos bis zum Ende des aktuellen Datums anschauen. Wenn dein Abo wöchentlich ist und deine letzte Verlängerung am Montag erfolgte, hast du Zugang bis Sonntag (7 Tage).')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-k0d0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.q.6', 'Die mobile Website erkennt mein Konto und mein Abonnement für 100% Sport nicht')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-96k0-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'faq.a.6', 'Überprüfen Sie, ob Ihre 3G- oder WIFI-Verbindung ordnungsgemäß funktioniert. Wenn ja und dieses Problem besteht weiterhin, bitte kontaktieren Sie uns unter Angabe Ihres Problems, Ihrer Telefonnummer, Ihres Mobilfunkbetreibers und Ihres Mobilgeräts.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dcc13q', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'wifi.form.select_country', 'Land auswählen')");
