        $this->addSql("INSERT INTO translations (uuid, language_id, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dc3qba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', 'wifi.warning', 'Hoppla! Wir konnten deine Handynummer nicht erkennen. Bitte wähle Land und Betreiber und gib deine Handynummer ein. Du erhältst einen PIN-Code per SMS')");
